import React from 'react';
import logo from '../images/logo.png'
import AccessAlarmIcon from '@mui/icons-material/AccessAlarm';
import imge from '../images/logo.png'
import StarIcon from '@mui/icons-material/Star';
import StarHalfIcon from '@mui/icons-material/StarHalf';
import Button from '@mui/material/Button';
import PrettyRating from "pretty-rating-react";
import { useState } from 'react';
import {
    faHeart,
    faStar,
    faHeartBroken,
    faStarHalfAlt,
} from "@fortawesome/free-solid-svg-icons";
import {
    faHeart as farHeart,
    faStar as farStar,
} from "@fortawesome/free-regular-svg-icons";



export default function Card() {
    const icons = {
        star: {
            complete: faStar,
            half: faStarHalfAlt,
            empty: farStar,
        },
        heart: {
            complete: faHeart,
            half: faHeartBroken,
            empty: farHeart,
        },
    };

    const colors = {
        star: ['#d9ad26', '#d9ad26', '#434b4d'],
        heart: ['#9b111e', '#a83f39'],
    };

    const [style, setStyle] = useState({ display: 'none' });

    return <>
        <div className='cardName'>
            {/* <div className='disc'>
            </div> */}
            <div className='topLeft2'>23%</div>
            <div className='cont'>
                <img src={imge} alt="Logo" className='img' />
                <div className='topLeft1'>RECOMMENDED</div>
            </div>
            <div className='productName'>
                <p className='firstproduct'>All Natural Italian-Style Chicken Meatballs</p>
                <p className='Secondproduct'>IN STOCK</p>
                <p className='thirdproduct' ><PrettyRating value={5} sx={{ fontSize: 3 }} icons={icons.star} colors={colors.star} /></p>
                <div className='fourthproduct'>
                    <div className='fourthproductFirst'><del>$150</del>&nbsp;&nbsp;</div>
                    <div className='fourthproductSecond'>$70</div>
                </div>

            </div>
            <Button sx={{borderRadius:"10px" ,display:"inline-block",paddingHorizontal:10,padding}} variant="contained">ADD TO CART</Button>
        </div>


        {/* <div className="App">
            <h2>Hidden Button in the box. Move mouse in the box</h2>
            <div style={{ border: '1px solid gray', width: 300, height: 300, padding: 10, margin: 100 }}
                onMouseEnter={e => {
                    setStyle({ display: 'block' });
                }}
                onMouseLeave={e => {
                    setStyle({ display: 'none' })
                }}
            >
                <button style={style}>Click</button>
            </div>
        </div> */}
    </>
}
